('31153', '311531919', '2021-07-02 14:33:43', '2021-07-17', 'iOS Development', 'Full Time iOS Developer', 'We are looking for an iOS developer responsible for the development and maintenance of applications aimed at a range of iOS devices including mobile phones and tablet computers. Your primary focus will be development of iOS applications and their integration with back-end services. You will be working alongside other engineers and developers working on different layers of the infrastructure.', 9000000, 'Staff', '2+ Years work experience developing Mobile applications Bachelor degree or equivalent experience in computer science, information technology, software engineering or related. Experience with iOS and/or Android development Published a mobile app in the App Store or the Google Play store Experience developing software within an Agile development cycle', 'Jakarta, Indonesia', 'semangat', 0),
('31153', '542090', '2021-07-11 09:29:47', '2021-09-28', 'UI/UX', 'UI/UX Designer', 'we looking for UI/UX designer who have expertise in the field of visual design, where they will be responsible for the User Experience and product visual design aspects, collaborate with product engineers and prepare and follow up for testing', 6800000, 'Staff', '2+ years of end-to-end UI/UX design in software/web technologies. Proficient with design and prototyping software such as Sketch, XD, Figma, or Framer.', 'Makassar, Indonesia', '', 0),
